import styled from "styled-components";
import HomeRanking from "../components/HomeRanking";
import MainList from "../components/MainList";
import { fetchNums, fetchArticles } from "./store/api";
import { useDispatch } from "react-redux";
import { topActions } from "./store/top-slice";

const Main = styled.div``;

const Home = () => {
  const dispatch = useDispatch();
  const url = "https://hacker-news.firebaseio.com/v0/topstories.json";
  (async () => {
    const data = await fetchNums(url);
    const objArr = await fetchArticles(data, 5);
    dispatch(topActions.addJson(objArr));
  })();
  return (
    <Main>
      <HomeRanking></HomeRanking>
      <MainList></MainList>
    </Main>
  );
};

export default Home;
